import React, { useState } from "react";

function InvestForm(props) {
  const [userInput, setuserInput] = useState([
    {
      currentSavings: "",
      yearlySavings: "",
      expectedReturn: "",
      investmentDuration: "",
    },
  ]);
  const handleSubmit = (event) => {
    event.preventDefault();
    console.log(userInput);
    props.sendDataToParent(userInput);

    console.log("Form submitted:");
  };
  const handleChange = (event) => {
    const { name, value } = event.target;

    setuserInput((prevFormData) => ({
      ...prevFormData,
      [name]: value,
    }));
  };
  const handleReset = () => {
    setuserInput({
      currentSavings: "",
      yearlySavings: "",
      expectedReturn: "",
      investmentDuration: "",
    });
  };
  return (
    <div>
      <form className="form" onSubmit={handleSubmit}>
        <div className="input-group">
          <p>
            <label htmlFor="current-savings">Current Savings ($)</label>
            <input
              type="number"
              id="current-savings"
              name="currentSavings"
              value={userInput.currentSavings}
              onChange={handleChange}
            />
          </p>
          <p>
            <label htmlFor="yearly-contribution">Yearly Savings ($)</label>
            <input
              type="number"
              id="yearly-contribution"
              name="yearlySavings"
              value={userInput.yearlySavings}
              onChange={handleChange}
            />
          </p>
        </div>
        <div className="input-group">
          <p>
            <label htmlFor="expected-return">
              Expected Interest (%, per year)
            </label>
            <input
              type="number"
              id="expected-return"
              name="expectedReturn"
              value={userInput.expectedReturn}
              onChange={handleChange}
            />
          </p>
          <p>
            <label htmlFor="duration">Investment Duration (years)</label>
            <input
              type="number"
              id="duration"
              name="investmentDuration"
              value={userInput.investmentDuration}
              onChange={handleChange}
            />
          </p>
        </div>
        <p className="actions">
          <button type="reset" className="buttonAlt" onClick={handleReset}>
            Reset
          </button>
          <button type="submit" className="button">
            Calculate
          </button>
        </p>
      </form>

      {/* Todo: Show below table conditionally (only once result data is available) */}
      {/* Show fallback text if no data is available */}

      <table className="result">
        <thead>
          <tr>
            <th>Year</th>
            <th>Total Savings</th>
            <th>Interest (Year)</th>
            <th>Total Interest</th>
            <th>Invested Capital</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>YEAR NUMBER</td>
            <td>TOTAL SAVINGS END OF YEAR</td>
            <td>INTEREST GAINED IN YEAR</td>
            <td>TOTAL INTEREST GAINED</td>
            <td>TOTAL INVESTED CAPITAL</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
}
export default InvestForm;
